  \"2014-07-15T21:11:42.789696\",\n\t\"name\": \"legume-information-system\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"LIS stores genetic and genomic data for
  crops and modal species in the legume family. LIS stores datasets from numerous
  legumes through species-specific webpages, and uses the reference species Glycine
  max, Lotus japonicus, and Medicago truncatula as a basis for comparisons between
  and among diverse legume species. Other genomes are being added as they become available.
  For other legume species, LIS hosts transcriptome assemblies (both traditional EST
  and NGS-based) and other datasets. Comparative maps, reference datasets, sequence
  search tools, etc. make these datasets available for exploration and discovery.
  New features in 2013 include powerful new sequence-search methods and interfaces;
  new genome browsers for chickpea, common bean, and pigeonpea; inferred syntenic
  relationships between all sequenced legume genomes; and a new database of trait
  and QTL data for bean and peanut. LIS is funded by the USDA-ARS, and is developed
  and maintained jointly by the National Center for Genome Resources (NCGR) and the
  USDA-ARS at Ames, Iowa.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
